    @test res[1] == MOI.INFEASIBLE
    res = NORBiP.solve_near_optimal(bp, NORBiP.RandomizedSingleVertexHeuristic(3), 0.1, () -> SCIP.Optimizer(display_verblevel=0), silent=true, sublimit=1000)
    @test res[1] == MOI.INFEASIBLE
